import React from 'react'
import './styles/slider.css';
import Card from '../card'
import Carousel from 'react-elastic-carousel';

function slider() {
    return (
        <div className ="slider">
            <Carousel>
                <Card />
                <Card />
                <Card />
            </Carousel>
            
        </div>
    )
}

export default slider
